INSERT INTO `wp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'Un comentarista de WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2021-11-05 11:24:15', '2021-11-05 11:24:15', 'Hola, esto es un comentario.\nPara empezar a moderar, editar y borrar comentarios, por favor, visita la pantalla de comentarios en el escritorio.\nLos avatares de los comentaristas provienen de <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', 'comment', 0, 0),
(2, 14, 'John Mechling', '', '', '', '2020-05-07 16:57:17', '2020-05-07 16:57:17', 'lNunc feugiat cursus netus urna pharetra maecenas magnis nisl libero eleifend, ultrices id ex massa sociosqu lectus orci ultricies etiam, in pellentesque varius eu purus ligula pretium ullamcorper vestibulum.', 0, '1', '', 'comment', 0, 0),
(3, 14, 'Tanya Munhall', '', '', '', '2020-05-07 16:57:38', '2020-05-07 16:57:38', 'Dapibus himenaeos dolor mus habitasse efficitur ex bibendum auctor, erat tempus facilisi adipiscing class cubilia metus pretium, egestas litora risus massa accumsan leo ipsum elit, turpis dui enim purus fermentum primis phasellus.', 0, '1', '', 'comment', 0, 0),
(4, 14, 'John Doe', '', '', '', '2020-05-07 16:57:54', '2020-05-07 16:57:54', 'Nam platea fringilla ad senectus eget taciti feugiat neque eleifend, mauris dolor rhoncus dapibus euismod placerat lacinia bibendum, praesent lorem nec augue risus hendrerit diam enim.', 0, '1', '', 'comment', 0, 0);
