img\n                alt=\"Logotipo de Europa Press\"\n                src=\"/wp-content/themes/hello-elementor/img/europa-press@2x.png\"\n              />\n    </section>		\n			    <section>\n          <h4>\n            No te preocupes por el papeleo.<br />Nosotros cancelamos tu actual seguro por tí.\n          </h4>\n                  1\n                <p>\n                  Rellena el <b>cuestionario</b> en menos de <b>2 minutos</b>\n                </p>\n                  2\n                <p>\n                  Te pediremos <b>un par de datos</b> sobre tu actual póliza\n                </p>\n                  3\n                <p>\n                  Activaremos <b>el proceso de baja</b> y\n                  <b>te avisaremos</b> en cuanto esté\n                </p>\n    </section>		\n			    <section>\n            <h3>Tu precio con Getlife</h3>\n            <h6>\n              Compara por ti mismo y comprueba con tus ojos\n            </h6>\n            <p>\n              Getlife trae un nuevo seguro de vida con un objetivo: que todas\n              las familias puedan estar protegidas.\n            </p>\n            <p>\n              Un producto 100% online con un precio asequible que podrás\n              contratar en tan solo unos minutos, sin la necesidad de agentes ni\n              exámenes médicos.\n            </p>\n            <button type=\"button\">\n              CALCULA TU AHORRO\n            </button>\n            <img\n              alt=\"Gráfica que refleja el ahorro con Getlife con respecto a los seguros de vida que ofrecen los bancos\"\n              src=\"/wp-content/themes/hello-elementor/img/ahorro-bancos.svg\"\n              loading=\"lazy\"\n            />\n    </section>		\n			    <section>\n          <h3>\n            Cómo tramitamos la baja de tu seguro con otra compañía\n          </h3>\n              <p>\n                Para poder empezar el proceso necesitamos saber la fecha de\n                renovación de tu seguro actual.\n              </p>\n              <p>\n                Para la mayoría de seguros, el periodo de preaviso mínimo es de\n                30 días antes de la renovación.\n              </p>\n              <p>\n                Este es el caso más común: Tu contrato con Getlife se activaría\n                automáticamente al día siguiente de la baja.\n              </p>\n              <img\n                alt=\"Pasos del proceso de cancelación de tu actual seguro de vida\"\n                src=\"/wp-content/themes/hello-elementor/img/pasos-cancelacion@2x.png\"\n                loading=\"lazy\"\n              />\n    </section>		\n			    <section>\n            <h3>\n              Justo: Protegemos al banco pero también a los tuyos.\n            </h3>\n            <p>\n              El seguro de vida tradicional protege al banco en caso de\n              siniestro (fallecimiento o invalidez del asegurado).\n            </p>\n            <p>\n              El parte del capital asegurado irá a la entidad bancaria para\n              cubrir el importe que quede por pagar ...\n            </p>\n            <button type=\"button\">\n              CONTRATAR\n            </button>\n            <button type=\"button\">\n              CALCULA TU AHORRO\n            </button>\n            <img\n              alt=\"Pareja en la playa con un niño\"\n              src=\"/wp-content/themes/hello-elementor/img/couple-with-child@2x.png\"\n              looading=\"lazy\"\n            />\n    </section>		\n			    <section>\n        <h2>\n          Un equipo de expertos disponible para ti.\n        </h2>\n        <h5>\n          ¿Prefieres hablar con personas? Estamos a tu disposición.\n        </h5>\n        <img\n          alt=\"Foto grupal de algunos trabajadores de Getlife\"\n          src=\"/wp-content/themes/hello-elementor/img/group-674@2x.png\"\n          loading=\"lazy\"\n        />\n          <button\n            type=\"button\"\n          >\n            question_answerEscríbir en el chat\n          </button>\n          <button\n            type=\"button\"\n          >\n            phoneLlamar\n          </button>\n          <button\n            type=\"button\"\n            class=\"\n              d-md-none\n              btn btn--Big btn-secondary\n              mx-0 mx-md-3\n              btn--hasIcon\n            \"\n          >\n            support_agentReservar cita\n          </button>\n          <button\n            type=\"button\"\n            class=\"\n              d-none d-md-block\n              btn btn--Big btn-secondary\n              mx-0 mx-md-3\n              btn--hasIcon\n            \"\n          >\n            support_agentReservar cita con un experto\n          </button>\n    </section>		\n			    <section>\n        <p>Trustpilot</p>\n        <h3>Así nos clasifican nuestros clientes:</h3>\n                  <p>\n                    <img\n                      alt=\"Estrella de puntuación de crítica online en Trustpilot\"\n                      src=\"/wp-content/themes/hello-elementor/img/star.svg\"\n                    /><img\n                      alt=\"Estrella de puntuación de crítica online en Trustpilot\"\n                      src=\"/wp-content/themes/hello-elementor/img/star.svg\"\n                    /><img\n                      alt=\"Estrella de puntuación de crítica online en Trustpilot\"\n                      src=\"/wp-content/themes/hello-elementor/img/star.svg\"\n                    /><img\n                      alt=\"Estrella de puntuación de crítica online en Trustpilot\"\n                      src=\"/wp-content/themes/hello-elementor/img/star.svg\"\n                    /><img\n                      alt=\"Estrella de puntuación de crítica online en Trustpilot\"\n                      src=\"/wp-content/themes/hello-elementor/img/star.svg\"\n                    />\n                  </p>\n                  <p>A través de Trustpilot</p>\n                <h5>Muy diferente al seguro tradicional</h5>\n         